import React, { Component } from 'react';
import './App.css';
import {Home} from './components/Home/Home'
import {eel} from './eel.js'

class App extends Component {
  constructor(props){
    super(props)
    eel.set_host("ws://localhost:8888")
  }
  render() {
    return <Home/>
  }
}

export default App;
